DELETE BB 
FROM #TempBankBranchIndia BB
INNER JOIN dbo.API_BANK_BRANCH_LIST ABB
ON	BB.BRANCH_CODE=ABB.BRANCH_CODE1 AND ABB.IS_ACTIVE=1
SELECT	* FROM #TempBankBranchIndia
RETURN
UPDATE	tbb
SET	tbb.BANK_CODE=ABL.BANK_ID
FROM #TempBankBranchIndia tbb
INNER JOIN dbo.API_BANK_LIST ABL ON ABL.BANK_CODE1=tbb.BANK_CODE

